script: |
  super -f text -I q7335.spq | sort > q7335.out

inputs:
  - name: q7335.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE + col1 NOT BETWEEN + col1 * + + ( + col0 ) - - - col0 + col2 AND - - col0 * + col1 + + CAST ( - 2 AS REAL );
  - name: tab2

outputs:
  - name: q7335.out
    data: |
      46	51	23
      64	77	40
      75	67	58
